import React from 'react';
import "./Login.scss";
import logoimg from "../../Assets/Engame_logo.png";

function LoginPage() {
  return (
    <div className='login_box'>
      <div className='leftbox'></div>
      <div className='rightbox'>
        <div className='lb_imgbox'>
          <img src={logoimg}/>
        </div>
        <div className='lb_body'>
          <input className='lb_inputclass' type="text" placeholder='Username'/>
          <input className='lb_inputclass' type="password" placeholder='Password'/>
          <button className='login_btn'>Login</button>
        </div>
      </div>
    </div>
  )
}

export default LoginPage
